        if (!Application.isPlaying && !mazeGenerated) // Solo generar si an no ha sido generado
        {
            GenerateMaze();
        }
    }
#endif

    void GenerateMaze()
    {
        if (mazeGenerated) return; // Evita generar el laberinto si ya ha sido generado

        DestroyPreviousMaze(); // Asegura que no haya duplicados
        CombineMeshesForMaze(); // Combina las mallas del laberinto

        mazeGenerated = true; // Marca el laberinto como generado
    }

    void DestroyPreviousMaze()
    {
        GameObject walls = GameObject.Find("CombinedWalls");
        GameObject floors = GameObject.Find("CombinedFloors");

        if (walls) DestroyImmediate(walls);
        if (floors) DestroyImmediate(floors);
    }

    void CombineMeshesForMaze()
    {
        CombineInstance[] wallCombines = new CombineInstance[CountCells(1)];
        CombineInstance[] floorCombines = new CombineInstance[CountCells(0)];

        int wallIndex = 0;
        int floorIndex = 0;

        for (int x = 0; x < maze.GetLength(0); x++)
        {
            for (int y = 0; y < maze.GetLength(1); y++)
            {
                Vector3 position = new Vector3(x * cellSize.x, 0, y * cellSize.y);

                if (maze[x, y] == 1) // Pared
                {
                    wallCombines[wallIndex] = CreateCombineInstance(wallPrefab, position, wallScale);
                    wallIndex++;
                }
                else if (maze[x, y] == 0) // Suelo
                {
                    floorCombines[floorIndex] = CreateCombineInstance(floorPrefab, position, Vector3.one);
                    floorIndex++;
                }
            }
        }

        // Dividir las mallas de las paredes en 9 partes
        if (wallCombines.Length > 0)
        {
            DivideAndCreateCombinedObject(wallCombines, "CombinedWalls", wallPrefab.GetComponent<MeshRenderer>().sharedMaterial);
        }

        // Dividir las mallas del suelo en 9 partes
        if (floorCombines.Length > 0)
        {
            DivideAndCreateCombinedObject(floorCombines, "CombinedFloors", floorPrefab.GetComponent<MeshRenderer>().sharedMaterial);
        }
    }

    CombineInstance CreateCombineInstance(GameObject prefab, Vector3 position, Vector3 scale)
    {
        MeshFilter meshFilter = prefab.GetComponent<MeshFilter>();
        Matrix4x4 matrix = Matrix4x4.TRS(position, Quaternion.identity, scale);

        return new CombineInstance
        {
            mesh = meshFilter.sharedMesh,
            transform = matrix
        };
    }

    void DivideAndCreateCombinedObject(CombineInstance[] combines, string name, Material material)
    {
        int totalObjects = combines.Length;
        int batchSize = totalObjects / 9; // Dividir en 9 partes
        int remainder = totalObjects % 9;
        int startIndex = 0;

        for (int i = 0; i < 9; i++)
        {
            int currentBatchSize = batchSize + (i < remainder ? 1 : 0); // Ajustar el tamao del lote

            // Crear un nuevo lote de CombineInstance para este pedazo
            List<CombineInstance> batch = new List<CombineInstance>();

            for (int j = startIndex; j < startIndex + currentBatchSize; j++)
            {
                batch.Add(combines[j]);
            }

            // Crear el objeto combinado para este lote
            CreateCombinedObject(batch.ToArray(), name + "_" + i, material);
            startIndex += currentBatchSize; // Avanzar al siguiente grupo
        }
    }

    void CreateCombinedObject(CombineInstance[] combines, string name, Material material)
    {
        if (combines.Length == 0) return;

        GameObject combinedObject = new GameObject(name);

        MeshFilter meshFilter = combinedObject.AddComponent<MeshFilter>();
        MeshRenderer meshRenderer = combinedObject.AddComponent<MeshRenderer>();
        MeshCollider meshCollider = combinedObject.AddComponent<MeshCollider>();

        Mesh combinedMesh = new Mesh
        {
            indexFormat = UnityEngine.Rendering.IndexFormat.UInt32 // Permite ms vrtices
        };

        combinedMesh.CombineMeshes(combines);
        meshFilter.mesh = combinedMesh;

        meshRenderer.material = material;
        meshCollider.sharedMesh = combinedMesh;

        combinedObject.isStatic = true;
    }

    int CountCells(int value)
    {
        int count = 0;
        for (int x = 0; x < maze.GetLength(0); x++)
        {
            for (int y = 0; y < maze.GetLength(1); y++)
            {
                if (maze[x, y] == value) count++;
            }
        }
        return count;
    }
}
